import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  Nav,
  NavItem,
  NavLink
} from "reactstrap";

const NavBox = () => {
  const [collapsed, setCollapsed] = useState(true);

  const toggleNavbar = () => {
    setCollapsed(!collapsed);
  };

  return (
    <div>
      <Navbar color="faded" light>
        <NavbarToggler onClick={toggleNavbar} className="mr-2" />
        <Collapse isOpen={!collapsed} navbar>
          <Nav navbar>
            <NavItem>
              <NavLink href="#portfolio-section">Portfolio</NavLink>
            </NavItem>
            <NavItem>
              <NavLink
                target="_blank"
                href="https://www.linkedin.com/in/robbie-porter-85a10a82/"
              >
                LinkedIn
              </NavLink>
            </NavItem>
            <NavItem>
              <NavLink target="_blank" href="https://github.com/Hammurobbie">
                GitHub
              </NavLink>
            </NavItem>
          </Nav>
        </Collapse>
      </Navbar>
    </div>
  );
};

export default NavBox;
